DROP DATABASE IF EXISTS farm_monitoring;
CREATE Database farm_monitoring;

use farm_monitoring;

CREATE TABLE user(
	username VARCHAR(30) NOT NULL PRIMARY KEY,
	password VARCHAR(30) NOT NULL,
	name VARCHAR(50),
	birthday DATE,
	age INT(3),
	type VARCHAR(10) NOT NULL
);


CREATE TABLE plot(
	plotId INT(5) NOT NULL PRIMARY KEY,
	area INT(10),
	capacity INT(10),
	plotStatus VARCHAR(10),
	username VARCHAR(30) NOT NULL
);

CREATE TABLE report(
	reportId INT(5) NOT NULL AUTO_INCREMENT PRIMARY KEY,
	reportname VARCHAR(20),
	username VARCHAR(20)
);

CREATE TABLE farmActivity(
	activityName VARCHAR(20)  NOT NULL PRIMARY KEY,
	startDate DATE,
	dueDate DATE,
	activityStatus VARCHAR(10) NOT NULL,
	requestNo INT(5)
);

CREATE TABLE crop(
	cropNumber INT(5) NOT NULL AUTO_INCREMENT PRIMARY KEY,
	type VARCHAR(20),
	cropCount INT(10),
	plotId INT(5)
);

CREATE TABLE request(
	requestNo INT(5) NOT NULL AUTO_INCREMENT PRIMARY KEY,
	requestDate DATE,
	username VARCHAR(30),
	requestDefinition VARCHAR(50)	
);

ALTER table farmActivity add FOREIGN KEY (requestNo) references request(requestNo);
ALTER table plot add FOREIGN KEY (username) references user(username);
ALTER table request add FOREIGN KEY (username) references user(username);
ALTER table report add FOREIGN KEY (username) references user(username);
ALTER table crop add FOREIGN KEY (plotId) references plot(plotId);



